SELECT toDate('2016-11-01') AS d, uniqState(toUInt64(arrayJoin(range(100)))) AS s;

insert into summing_merge_tree_aggregate_function select today() as d,
number as k,
uniqState(toUInt64(number % 500))
from numbers(5000)
group by d, k;

insert into summing_merge_tree_aggregate_function select today() as d,
number + 5000 as k,
uniqState(toUInt64(number % 500))
from numbers(5000)
group by d, k;
